const Layout = ({children}) => {
  return(
    <div className="wrapper">
      <Head>
        <title>横浜の美容整体サロン | Regalo</title>
      </Head>
      {Reset}
      {Style}
      <style jsx>{styles}</style>
      <Header />
      {children}
      <Contact />
      <Footer />
    </div>
  )
}

const styles = css`
